(7211, 73, 0, 0, 0, 'That''s full-time, and Man City eventually ease to a 4-1 victory over Spurs! The visitors were in the game up until Roberto Soldado''s penalty miss, but four goals from Sergio Aguero - including two from the penalty spot - have put Manuel Pellegrini''s side within two points of Chelsea.'),
(7212, 73, 90, 0, 0, 'Danny Rose goes down under a shove from Kompany and Spurs appeal for another penalty - that would have been the fifth of the game, but Moss is, for once, unmoved at the opportunity to point to the spot.'),
(7213, 73, 90, 0, 0, 'It''s Townsend who strikes it straight into the wall - he''s been disappointing since coming on.'),
(7214, 73, 90, 0, 0, 'We''re into three minutes of added time, and Chadli wins a free kick 25 yards out. Can Eriksen add a consolation goal?'),
(7215, 73, 90, 0, 0, 'It''s been a tough day for Spurs, who looked dangerous up until Soldado''s penalty miss. That would have turned the game on its head, but the difference today has been the strikers - City have one who take his chances, and Spurs have one who simply doesn''t.'),
(7216, 73, 88, 0, 0, 'Sergio Aguero wants five, but gets tackled as he shapes to shoot - he really should have fed Jovetic who was open, but he''s not about to start passing today!'),
(7217, 73, 87, 0, 0, 'OFF THE POST! Milner bends a lovely effort at goal from 25 yards, but the ball cannons back off the woodwork and to safety!'),
(7218, 73, 86, 0, 0, 'Only two City players have scored four goals in a single Premier League game according to Opta Sports - Sergio Aguero and Edin Dzeko - and both against Spurs. Dear oh dear...'),
(7219, 73, 84, 0, 0, 'Jovetic puts Milner through with a lovely flicked pass, but the England midfielder''s weak header is easily cleared. City could put Spurs to the sword, but seem content to see this one out now.'),
(7220, 73, 82, 0, 0, 'The tempo has lowed in the last few minutes, with City taking a slight  breather and Spurs, understandably, letting them do so.'),
(7221, 73, 80, 0, 0, 'Townsend as barely made an impact since coming on, and swerves a fierce effort from 25 yards over the bar. It''s surely damage limitation for Spurs now.'),
(7222, 73, 79, 0, 0, 'Jesus Navas s teed up by Toure on the right wing and volleys in a cross, but Lloris is quickly out to meet it. What must the France No.1 be thinking? Spurs will do well to keep hold of him beyond this season if things carry on.'),
(7223, 73, 77, 0, 0, 'Kaboul tries to dribble the ball out of defence and loses possession in defensive midfield, but Rose is alert and prevents a potential fifth - that is simply ridiculous play from Spurs'' captain.'),
(7224, 73, 76, 0, 0, 'Just what Spurs need - Yaya Toure has replaced Fernando.'),
(7225, 73, 75, 1, 1, 'GOAL IT''S FOUR FOR AGUERO! What a performance from the City striker, who bursts onto a through-ball down the right flank, cuts inside Jan Vertonghen and curls a beauty of a shot into the far corner of Lloris'' net with his weaker left foot - stunning!'),
(7226, 73, 73, 0, 0, 'Christian Eriksen has a chance to reduce the deficit here, but strikes a weak free kick straight into the City wall.'),
(7227, 73, 71, 0, 0, 'Any glimmer of hope for Spurs has surely now disappeared, as errors at both ends of the field - well, from both penalty spots at least - have cost them today.'),
(7228, 73, 69, 0, 0, 'According to Opta Sports, this is only the second game in Premier League history to see the award of four penalties - after Bradford vs. Derby in 2000.'),
(7229, 73, 68, 1, 1, 'GOAL AGUERO FINALLY HAS HIS HAT TRICK! Aguero steps up for his third spot kick of the afternoon, and puts it exactly in the same spot as his first, sending Lloris the wrong way again.'),
(7230, 73, 66, 0, 0, 'ANOTHER PENALTY TO CITY! That''s the fourth of the game, and Fazio is sent off! Rose makes a mistake on the wing and Navas crosses low, but Aguero is seemingly pulled back by Fazio, who is given his marching orders...'),
(7231, 73, 64, 0, 0, 'Fantastic save from Hart! The City goalkeeper brilliantly denies Soldado by stopping his ow 10-yard volley with a top stop with his body. Great reactions, and City survive...'),
(7232, 73, 63, 0, 0, 'That was the chance for Soldado to add to his solitary Premier League strike this calendar year, but his nightmare continues.'),
(7233, 73, 62, 0, 0, 'HART SAVES FROM SOLDADO! The Spanish striker steps up and strokes the ball towards goal, but the City keeper plunges to his right and tips away the weak effort! That is abysmal from Soldado - he telegraphed where he was putting that one.'),
(7234, 73, 61, 0, 0, 'PENALTY TO SPURS! The visitors finally have their spot kick as Soldado is tripped by Martin Demichelis on the edge of the area - contact was minimal, but Moss points to the spot for the third time today!'),
(7235, 73, 60, 0, 0, 'Pochettino decides it''s time for a chance as Townsend is on for Lamela, while Dembele replaces Mason.'),
(7236, 73, 59, 0, 0, 'So close for City! Silva is played in on the right of the area and slides the ball across goal, but it''s just too far for Aguero to slide in at the back post! The striker seems to have hurt himself in a collision there.'),
(7237, 73, 58, 0, 0, 'Lloris is down well to save a deflected drive from Navas - replays show the ball did strike Sagna''s arm on the revious Spurs attack, but the defender was so close to Eriksen a penalty would have been harsh.'),
(7238, 73, 57, 0, 0, 'Christian Eriksen sees an effort inside the box blocked and Spurs want a penalty for a handball, but Moss is unmoved. Rose in particular was screaming for a spot kick.'),
(7239, 73, 56, 0, 0, 'Nacer Chadli goes for goal of the season as he chests the ball down and volleys wide from 25 yards. Speculative to say the least.'),
(7240, 73, 55, 0, 0, 'Jesus Navas is the next player in Moss'' book as he cynically clips Capoue''s heels with a cheeky flick - no doubts about that.'),
(7241, 73, 54, 0, 0, 'Spurs are applying the pressure now as Rose wins a corner, and City are forced into clearing for another set-piece, but it''s an awful cross from Lamela, and City break to no avail.'),
(7242, 73, 53, 0, 0, 'Ryan Mason runs the ball out for a City goal kick after a hurried one-two - that wasn''t pretty, but the 23-year-old has been impressive in the middle for Spurs today.'),
(7243, 73, 51, 0, 0, 'City break at pace through Silva and Navas on the right, but the Spanish duo get it all wrong and give away possession cheaply in the Spurs box.'),
(7244, 73, 49, 0, 0, 'Spurs just cannot keep Aguero quiet as he meets another low cross from Navas at the near post, but despite Kaboul seemingly getting a flick to turn it away from danger, a goal kick is given.'),
(7245, 73, 48, 0, 0, 'Lloris saves from Aguero! The City forward smashes a low drive at goal from 25 yards which the Spurs keeper has to shovel back into the danger area, and his defenders clear.'),
(7246, 73, 47, 0, 0, 'Sergio Aguero is almost in from a long pass over the top, but Kaboul recovers well to tackle the striker before he can get a shot in on goal. The Spurs defence need to wake up, as that was so, so simple.'),
(7247, 73, 46, 0, 0, 'We''re back underway at the Etihad, with City stroking the ball about comfortably.'),
(7248, 73, 0, 0, 0, 'Both sides had 10 shots each in the first 45 minutes - I predicted a tight opening half but City and Spurs gladly proved me wrong. With the likes of Dzeko, Stevan Jovetic, Toure, Harry Kane, Andros Townsend and Emmanuel Adebayor still to come on, we could be in store for a grandstand finish.'),
(7249, 73, 0, 0, 0, 'Alan Sugar has tweeted that the Lampard penalty decision was an "absolute disgrace" and the City midfielder should have been booked for a dive - I wouldn''t go that far, but Spurs fans will not be happy with referee Moss.'),
(7250, 73, 0, 0, 0, 'What a stunning half of football that was! Man City lead Spurs 2-1 at the Etihad through two strikes from Sergio Aguero, though the striker missed the chance to add a third from the spot. Spurs will feel aggrieved at a couple of decisions from Jonathan Moss, but have shown more than enough to suggest this game is not yet beyond them.'),
(7251, 73, 47, 0, 0, 'City want a third before the whistle, but Navas sees his effort fly over the bar... and that''s the interval!'),
(7252, 73, 46, 0, 0, 'Eriksen and Soldado have been superb for Spurs today - their movement and enthusiasm up front have given City real problems, but Pochettino''s back line looks shaky every time the hosts go forward.'),
(7253, 73, 45, 0, 0, 'We''ll have three minutes of injury time, and Milner tries to add a third from range but is denied by Lloris.'),
(7254, 73, 44, 0, 0, 'Now it''s Lloris'' turn for an unconvincing save as Navas drives a high effort at the Spurs keeper, who pushes the ball over the bar. The France No.1 looks a little relieved there.'),
(7255, 73, 43, 0, 0, 'Roberto Soldado looks really sharp today as he gives Gael Clichy the slip down the line and plays in Eriksen, but City recover just in time to force the playmaker out of their penalty area.'),
(7256, 73, 41, 0, 0, 'David Silva proves he is human after all as he escapes in the Spurs box and looks to cross, but the ball slips of his right foot and out for a goal kick. Once in a blue moon...'),
(7257, 73, 40, 0, 0, 'Great save by Hart! Soldado cushions a lovely header into the path of Eriksen, who twists into the area - his pass is cleared only as far as Mason, who sees his fierce drive stopped brilliantly by the City keeper, and Soldado is then given offside.'),
(7258, 73, 39, 0, 0, 'Spurs are still in this game as Eriksen fashions an opening and blasts at goal from 25 yards, which Hart unconvincingly pushes wide for a corner. The keeper does better from the corner, punching the ball clear.'),
(7259, 73, 37, 0, 0, 'This game is becoming a real battle - Etienne Capoue leaves a foot in on Silva but escapes a caution. That was a nasty one.'),
(7260, 73, 36, 0, 0, 'Erik Dier is the next player in the book after dragging down Milner on the left flank for a clear tactical foul.'),
(7261, 73, 35, 0, 0, 'Danny Rose is in pain after Navas seems to leave a foot in on his heel - the City winger could be a little lucky to escape a booking there.'),
(7262, 73, 32, 0, 0, 'Ryan Mason has gone into the book, seemingly for something he said to referee Moss. What a fantastic first half we''ve had so far.'),
(7263, 73, 33, 0, 0, 'Aguero with another great chance! The City forward is determined to atone for that miss as he twists Kabou inside out, but Lloris makes a decent stop from the striker''s close-range thump.'),
(7264, 73, 31, 0, 0, 'AGUERO MISSES! The City striker weakly hits his penalty straight down the middle at Lloris'' legs, and then comically slices an acrobatic volley over after the ball spins up invitingly for him!'),
(7265, 73, 30, 0, 0, 'ANOTHER PENALTY FOR CITY! Milner dribbles down the left, cuts in and feeds a teasing pass for Silva, who is felled clumsily by Kaboul - that''s as clear-cut a decision as you''ll ever see. Aguero for a hat trick...'),
(7266, 73, 29, 0, 0, 'Eriksen fancies his chances from 30 yards, but his free kick flies a yard or two over Hart''s bar. Not a bad effort, but it needed something really special from that range.'),
(7267, 73, 28, 0, 0, 'Navas is tormenting Spurs down the right and fizzes over a cross that is just behind Silva - Spurs break and Chadli wins a free kick after a rough challenge from Kompany. A tempting range for Eriksen now...'),
(7268, 73, 26, 0, 0, 'This is the end of Lampard''s afternoon as he injures his thigh making a pass on the stretch. He departs on a stretcher to huge applause, but he looks in real pain - he could e out for a while. On comes Fernandinho, which is no comfort to Spurs.'),
(7269, 73, 24, 0, 0, 'Spurs have conceded three penalties in eight games this season - joint top with Manchester United in the Premier League. It was a soft decision, but Lamela gave Moss a decision to make with a clumsy lunge.'),
(7270, 73, 23, 0, 0, 'Aguero almost nets his hat trick, escaping his marker and meeting a low Navas pull-back, but Lloris gets everything behind it to prevent a third for the striker.'),
(7271, 73, 21, 0, 0, 'Well, what a start we''ve had to this game! Nacer Chadli tries to collect a high through-ball, but Hart is out quickly to collect it - Spurs are fuming about that penalty, and they may well have a legitimate complaint.'),
(7272, 73, 20, 0, 0, 'AGUERO SCORES! The City striker steps up and sends Lloris the wrong way, confidently stroking the ball into the bottom right-hand corner of the net. Aguero is now City''s all-time Premier League top scorer, and we''ve still got 70 minutes left today!'),
(7273, 73, 18, 0, 0, 'PENALTY TO CITY! Lampard exchanges a one-two with James Milner and goes down under a challenge from Lamela, and Moss points to the spot. You won''t see many softer decisions than that today, but it''s a great chance for the hosts...'),
(7274, 73, 17, 0, 0, 'City should be ahead again as Fernando meets a corner unmarked, but puts his effort wide of the post - Spurs have to do better picking up their opponents on set-pieces, otherwise they''ll be punished.'),
(7275, 73, 15, 0, 0, 'SPURS ARE LEVEL! It''s a horrible mistake from Fernando as he loses possession easily in defensive midfield to Mason, who feeds Soldado - the striker plays in Eriksen, who makes no mistake this time as Hart can only deflect his fierce drive off the bar and into the net!'),
(7276, 73, 13, 0, 0, 'GREAT GOAL BY AGUERO! This is a top strike by a world-class player - Lampard steals possession and feeds the Argentine on the left of Spurs'' area, and Aguero take his time before shaping the ball and smashing it across Lloris into his bottom left-hand corner!'),
(7277, 73, 11, 0, 0, 'Navas puts in a low teasing cross which Lloris gets a hand to - City want an indirect free kick as Younes Kaboul seems to control the ball allowing the goalkeeper to collect it but referee Jonathan Moss is not convinced.'),
(7278, 73, 9, 0, 0, 'City are close to taking the lead now as Aguero is fed through on the six-yard line but can''t quite apply the finishing touch - the striker is offside, but that was a real scare for Spurs after missing those gilt-edged chances.'),
(7279, 73, 8, 0, 0, 'Chances for Spurs! Ryan Mason should score as he''s put clean through on goal by Soldado, but Joe Hart spreads himself well and superbly saves with his foot! Spurs are back again moments later as Christian Eriksen wriggles free in the box, but blasts over when he should square the ball!'),
(7280, 73, 7, 0, 0, 'Both sides have settled into the flow of the game - City are controlling more of the possession, but Spurs are looking tricky up top...'),
(7281, 73, 5, 0, 0, 'David Silva tires to slot a delicate through-ball between the Spurs defenders to Aguero, but the centre-backs are alert to the threat and close up the space quickly. Both managers will be pleased so far.'),
(7282, 73, 3, 0, 0, 'Spurs are beginning to look like a Pochettino side as they pressure City high up the pitch, with Kompany again loses possession - in his own box this time - but the danger passes.'),
(7283, 73, 2, 0, 0, 'City have started well and Jesus Navas looks menacing down the right wing, swinging in a vicious cross which is cleared well by Fazio. The Argentine will have to be alert to Agueros movement in behind from those deliveries.'),
(7284, 73, 1, 0, 0, 'We''re up and running at the Etihad! Vincent Kompany loses out to Soldado, but City recover possession well - Aguero is almost in on goal after a bobble pass from Lampard, but Hugo Lloris is out quickly to collect.'),
(7285, 73, 0, 0, 0, 'City are playing in their traditional sky-blue strip, while Spurs are in their black away kit. Are you ready?'),
(7286, 73, 0, 0, 0, 'The teams are out at the Etihad and we''re almost ready for kick-off. Both sides have plenty of firepower on the bench, so we could see a tactical opening with plenty of goals late on - let''s hope so anyway!'),
(7287, 73, 0, 0, 0, 'Spurs'' main problem, however, is that they simply aren''t scoring enough goals. They have netted just nine Premier League goals this season - only seven teams have scorer fewer - and Roberto Soldado has scored just once in the league in 2014. He leads the line today...'),
(7288, 73, 0, 0, 0, 'We''re less than 10 minutes from kick-off at the Etihad, and while City will be favourites, Spurs may fancy a shock today. They have conceded just seven goals this term, and with Pellegrini not naming the strongest of starting lineups, there is the potential for an upset.'),
(7289, 73, 0, 0, 0, 'With City sitting five points off league leaders Chelsea after just seven games, they can ill-afford a slip-up today at home. Titles aren''t won this early in the season, but given the ominous form Jose Mourinho''s side are showing, Pellegrini will know just how important today''s test is.'),
(7290, 73, 0, 0, 0, 'Today''s game is also a big test for Spurs midfielder Ryan Mason. The 23-year-old will be counting his lucky stars that both Yaya Toure and Fernandinho have been benched today, but that will also perhaps put a little more pressure on Mason to impose himself.'),
(7291, 73, 0, 0, 0, 'Edin Dzeko has scored six goals in six Premier League games against Spurs, but the big striker has to settle for a place on the bench as Sergio Aguero leads the line for the hosts today. Frank Lampard also starts for City, and the New York City FC loanee will be looking to carry on his impressive early season form with the English champions.'),
(7292, 73, 0, 0, 0, 'So Manuel Pellegrini makes six changes from the 2-0 victory over Aston Villa a fortnight ago, while Mauricio Pochettino will be hoping Spurs'' new centre-back Federico Fazio makes a fine first impression on his Premier League debut.'),
(7293, 73, 0, 0, 0, 'Spurs subs: Vorm, Vertonghen, Dembele, Stambouli, Townsend, Adebayor, Kane.'),
(7294, 73, 0, 0, 0, 'Spurs XI:  Lloris, Dier, Fazio, Kaboul (C), Rose; Capoue, Mason; Chadli, Eriksen, Lamela; Soldado.'),
(7295, 73, 0, 0, 0, 'Man City subs: Caballero, Kolarov, Boyata, Toure, Fernandinho, Jovetic, Dzeko.'),
(7296, 73, 0, 0, 0, 'Man City XI: Hart; Clichy, Demichelis, Kompany (C), Sagna; Milner, Lampard, Fernando; Navas, Silva, Aguero.'),
(7297, 73, 0, 0, 0, 'I''m Tom Doyle and I''ll be guiding you through all the action as it happens at the Etihad Stadium. With kick-off less than 30 minutes away, here''s some team news for you...'),
(7298, 73, 0, 0, 0, 'Referee Jonathan Moss gave four penalties during the game, and Spurs will feel aggrieved at a fair few of the decisions today - Mauricio Pochettino''s press conference should be fun - but it''s City who pick up three deserved points.'),
